9274.objetoCompra:
Serviço de manutenção de muro entre a Estação Rádio da Marinha e a colônia de
pescadores Z-10. Trata-se de um terreno de mangue, estrutura do muro
comprometida, causando riscos aos moradores da comunidade Z-10 e para a
segurança orgânica da própria Estação Rádio.
 Demolição de alvenaria com retirada de entulho;
 Execução de alvenaria em bloco de concreto;
 Execução de pintura em tinta acrílica lavável;
 Utilização de aditivo impermeabilizante na argamassa de assentamento dos
blocos.

9459.objetoCompra:
Aferição de tempo - Contratação de solução para organização de atividade esportiva

A) Aferição de partida e chegada, com 1 ponto de controle, com 4 metros de antenas;

B) Ponto de controle no percurso com 04 metros de antenas;

C) Captura de imagens de chegada para verificação pós prova (backup de aferição de tempo);

D) 1.200 chips de uso único (descartáveis);

E) 1.200 kits contendo: (número de peito com 3 serrilhas (impressão e/ou fundo colorido) com informativo de utilização de chip + 4 alfinetes + 1 envelope plástico transparente), etiquetados nominalmente;

F) 1 relógio para pórtico de chegada (dupla face), com lâmpadas de LED para visualização à distância em dias claros e escuros;

G) Conjunto de tenda 3 X 3 metros para partida e chegada com mesas e cadeiras;

H) Divulgação de resultados em site especializado no mesmo dia do evento; e

I) Transporte de material e equipe por conta da CONTRATADA; e

J) O envio dos kits e chips ocorrerá antecipadamente.

9459.informacaoComplementar:
Conforme regras contidas no Termo de Referência 85/2024.
Junto com a Nota de Empenho a CONTRATANTE enviará digitalmente um arquivo contendo as artes que estamparão os números de peito;
2 (dois) dias após o recebimento da arte que estamparão os números de peito, a CONTRATADA deverá apresentar um projeto final contendo a arte já estampada;
Após a aprovação final do projeto pela CONTRATANTE, a contratada deverá iniciar a produção total do objeto;
A entrega total do material deverá ser realizada em até 5 (cinco) dias após a autorização da CONTRATANTE para o início da produção;
A contratada será responsável pelo fornecimento do material incluindo o frete, até o local indicado no item 4.8;
A contratada será responsável pelos custos de hospedagem e alimentação da equipe de profissionais que realizarão serviço;
A contratada será responsável pela montagem do equipamento no dia 11 de setembro de 2024, a partir das 05h30min até 07h30min da manhã. A desmontagem ocorrerá no mesmo dia, logo após o término do evento; e
A entrega do material e a realização do serviço serão no Centro de Instrução e Adestramento Almirante Newton Braga – CIANB, localizado no interior da Base de Abastecimento da Marinha do Rio de Janeiro - (BAMRJ), Av. Brasil n° 10.500, Olaria, Rio de Janeiro, RJ, CEP 21012-350.

